import { useState } from 'react';
import SkillBar from './SkillBar';
import {Card, Typography} from '@mui/material';
import {ResponsiveContainer,PieChart, Pie,Cell, Tooltip} from 'recharts';


export default function Dashboard() {

    const PIE_COLORS = ["#49416D","#A882DD","#E08D79","#E0EFDE","#01A7C2"];
    const role_map = [
        {
            "role": "Data Engineer",
            "exp": 2
        },
        {
            "role": "Analytics Engineer",
            "exp": 1
        },
        {
            "role": "Software Engineer",
            "exp": 1.2,

        },
        {
            "role": "AI Engineer",
            "exp": 1
        },
    ]



    return (
        <div
            className="dash-container"
            style={{
                display:"flex"
            }}
        >

            <Card
                className="role-exp-pie"
                sx={{
                    padding:"30px",
                    width:"30%"
                }}
                >
                    <Typography 
                        variant='h5'
                        sx={{
                            textAlign: "left"

                        }}
                        >Roles</Typography>
                    <PieChart width={300} height={300} >
                        <Tooltip />
                        <Pie data={role_map} dataKey="exp" nameKey="role" fill='#55828B' label>
                        {role_map.map((entry, index) => <Cell fill={PIE_COLORS[index % PIE_COLORS.length]}/>)}
                        </Pie>

                    </PieChart>
                    <PieChart width={300} height={300} >
                        <Tooltip />
                        <Pie data={role_map} dataKey="exp" nameKey="role" fill='#55828B' >
                        {role_map.map((entry, index) => <Cell fill={PIE_COLORS[index % PIE_COLORS.length]}/>)}
                        </Pie>

                    </PieChart>

            </Card>
            <Card
                className="skill-exp-bar"
                sx={{
                    padding:"30px 10px 30px 20px",
                    width:"80%",
                    height:"100%"
                }}
            >
                <Typography 
                        variant='h5'
                        sx={{
                            textAlign: "left"

                        }}
                        >Skills </Typography>

                <SkillBar />
            </Card>


</div>
    );
}
